// pages/HomePage.js
import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import Header from './Header';
import WelcomeSection from './home/WelcomeSection';
import DailySummary from './home/DailySummary';
import FoodLog from './home/FoodLog';
import Recommendations from './home/Recommendations';
import DailyTips from './home/DailyTips';
import Footer from './Footer';

const HomePage = () => {
    const userName = "John";
    const dailySummary = { calories: 1200, protein: 45, carbs: 150, fats: 50 };
    const foodEntries = [
        { name: "Breakfast", calories: 300 },
        { name: "Lunch", calories: 600 },
        { name: "Dinner", calories: 500 },
    ];
    const mealSuggestions = ["Salad", "Grilled Chicken", "Smoothie"];
    const dailyTip = "Remember to stay hydrated! Drink at least 8 glasses of water a day.";

    return (
        <Container>
            <Header />
            <Row>
                <Col md={8}>
                    <WelcomeSection userName={userName} />
                </Col>
                <Col md={4}>
                    <DailySummary {...dailySummary} />
                </Col>
            </Row>
            <Row>
                <Col md={12}>
                    <FoodLog foodEntries={foodEntries} />
                </Col>
            </Row>
            <Row>
                <Col md={6}>
                    <Recommendations mealSuggestions={mealSuggestions} />
                </Col>
                <Col md={6}>
                    <DailyTips tip={dailyTip} />
                </Col>
            </Row>
            <Footer />
        </Container>
    );
};

export default HomePage;
